<h1 id="Pokemon">Pokemon<a class="anchor-link" href="#Pokemon">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Pokemon dataset to predict which Pokemon will win on a 1v1 fight. You can download the Jupyter Notebook of the study by clicking <a href="pokemon.ipynb">here</a>. To achieve our goals, we have access to the following data.</p>
<p>A table Pokemon with the information about the different Pokemons (Click <a href="../../data/pokemon/pokemon.csv">here</a> to download the dataset):</p>
<ul class="ul_content">
    <li><b>Legendary:</b> True if it is a Legendary Pokemon</li>
    <li><b>Sp_Atk:</b> Special Attack</li>
    <li><b>Generation:</b> Pokemon Generation</li>
    <li><b>Speed</b></li>
    <li><b>Sp_Def:</b> Special Defense</li>
    <li><b>Name</b></li>
    <li><b>Defense</b></li>
    <li><b>Type_1:</b> Pokemon first Type</li>
    <li><b>Type_2:</b> Pokemon second Type</li>
    <li><b>HP:</b> Number of life points</li>
    <li><b>Attack</b></li>
</ul><p>A table combats with information about the different fights (Click <a href="../../data/pokemon/combats.csv">here</a> to download the dataset):</p>
<ul class="ul_content">
    <li><b>First_pokemon:</b> Pokemon of trainer 1</li>
    <li><b>Second_pokemon:</b> Pokemon of trainer 2</li>
    <li><b>Winner:</b> Winner of the fight</li>
</ul><p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this use-case. The purpose is to show you some of the library interesting functionalities.</p>
<h2 id="Initialization">Initialization<a class="anchor-link" href="#Initialization">&#182;</a></h2><p>Let's ingest the datasets.</p>

