<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>The 'ID' will be the key to join the data. By joining the data, we will be able to create more relevant features.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[5]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">fights</span> <span class="o">=</span> <span class="n">pokemon</span><span class="o">.</span><span class="n">join</span><span class="p">(</span><span class="n">combats</span><span class="p">,</span> 
                      <span class="n">on</span> <span class="o">=</span> <span class="p">{</span><span class="s2">&quot;ID&quot;</span><span class="p">:</span> <span class="s2">&quot;First_Pokemon&quot;</span><span class="p">},</span> 
                      <span class="n">how</span> <span class="o">=</span> <span class="s2">&quot;inner&quot;</span><span class="p">,</span>
                      <span class="n">expr1</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;Sp_Atk AS Sp_Atk_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Speed AS Speed_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Sp_Def AS Sp_Def_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Defense AS Defense_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Type_1 AS Type_1_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Type_2 AS Type_2_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;HP AS HP_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Attack AS Attack_1&quot;</span><span class="p">],</span>
                      <span class="n">expr2</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;First_Pokemon&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Second_Pokemon&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Winner&quot;</span><span class="p">])</span><span class="o">.</span><span class="n">join</span><span class="p">(</span><span class="n">pokemon</span><span class="p">,</span> 
                      <span class="n">on</span> <span class="o">=</span> <span class="p">{</span><span class="s2">&quot;Second_Pokemon&quot;</span><span class="p">:</span> <span class="s2">&quot;ID&quot;</span><span class="p">},</span> 
                      <span class="n">how</span> <span class="o">=</span> <span class="s2">&quot;inner&quot;</span><span class="p">,</span>
                      <span class="n">expr2</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;Sp_Atk AS Sp_Atk_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Speed AS Speed_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Sp_Def AS Sp_Def_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Defense AS Defense_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Type_1 AS Type_1_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Type_2 AS Type_2_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;HP AS HP_2&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Attack AS Attack_2&quot;</span><span class="p">],</span>
                      <span class="n">expr1</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;Sp_Atk_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Speed_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Sp_Def_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Defense_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Type_1_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Type_2_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;HP_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Attack_1&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Winner&quot;</span><span class="p">,</span> 
                               <span class="s2">&quot;Second_pokemon&quot;</span><span class="p">])</span>
</pre></div>

</div>
</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Features Engineering is the key and by computing the difference between pokemon 1 and 2 qualities, we can create amazing features. We can also change Winner to a binary signal (1 if the first pokemon won, 0 otherwise).</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[6]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">fights</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;Sp_Atk_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Sp_Atk_1 - Sp_Atk_2&quot;</span><span class="p">)</span>
<span class="n">fights</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;Speed_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Speed_1 - Speed_2&quot;</span><span class="p">)</span>
<span class="n">fights</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;Sp_Def_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Sp_Def_1 - Sp_Def_2&quot;</span><span class="p">)</span>
<span class="n">fights</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;Defense_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Defense_1 - Defense_2&quot;</span><span class="p">)</span>
<span class="n">fights</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;HP_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;HP_1 - HP_2&quot;</span><span class="p">)</span>
<span class="n">fights</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;Attack_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Attack_1 - Attack_2&quot;</span><span class="p">)</span>
<span class="n">fights</span><span class="p">[</span><span class="s2">&quot;Winner&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">apply</span><span class="p">(</span><span class="s2">&quot;(CASE WHEN </span><span class="si">{}</span><span class="s2"> = Second_pokemon THEN 0 ELSE 1 END)&quot;</span><span class="p">)</span>
<span class="n">fights</span> <span class="o">=</span> <span class="n">fights</span><span class="o">.</span><span class="n">select</span><span class="p">([</span><span class="s2">&quot;Sp_Atk_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Speed_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Sp_Def_diff&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;Defense_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;HP_diff&quot;</span><span class="p">,</span> <span class="s2">&quot;Attack_diff&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;Type_1_1&quot;</span><span class="p">,</span> <span class="s2">&quot;Type_1_2&quot;</span><span class="p">,</span> <span class="s2">&quot;Type_2_1&quot;</span><span class="p">,</span> <span class="s2">&quot;Type_2_2&quot;</span><span class="p">,</span> 
                        <span class="s2">&quot;Winner&quot;</span><span class="p">])</span>
<span class="nb">print</span><span class="p">(</span><span class="n">fights</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

