<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python.learn.ensemble</span> <span class="k">import</span> <span class="n">RandomForestClassifier</span>
<span class="kn">from</span> <span class="nn">vertica_ml_python.learn.model_selection</span> <span class="k">import</span> <span class="n">cross_validate</span>

<span class="n">predictors</span> <span class="o">=</span> <span class="n">fights</span><span class="o">.</span><span class="n">get_columns</span><span class="p">(</span><span class="n">exclude_columns</span> <span class="o">=</span> <span class="p">[</span><span class="s1">&#39;Winner&#39;</span><span class="p">])</span>
<span class="n">response</span> <span class="o">=</span> <span class="s2">&quot;Winner&quot;</span>
<span class="n">relation</span> <span class="o">=</span> <span class="s2">&quot;pokemons_fights&quot;</span>
<span class="n">model</span> <span class="o">=</span> <span class="n">RandomForestClassifier</span><span class="p">(</span><span class="s2">&quot;rf_pokemon&quot;</span><span class="p">,</span> 
                               <span class="n">n_estimators</span> <span class="o">=</span> <span class="mi">50</span><span class="p">,</span> 
                               <span class="n">max_depth</span> <span class="o">=</span> <span class="mi">100</span><span class="p">,</span> 
                               <span class="n">max_leaf_nodes</span> <span class="o">=</span> <span class="mi">400</span><span class="p">,</span> 
                               <span class="n">nbins</span> <span class="o">=</span> <span class="mi">100</span><span class="p">)</span>
<span class="n">cross_validate</span><span class="p">(</span><span class="n">model</span><span class="p">,</span> <span class="n">relation</span><span class="p">,</span> <span class="n">predictors</span><span class="p">,</span> <span class="n">response</span><span class="p">)</span>
